import React, { Component } from "react";
let stars = [];
let star = " * ";

function starfill() {
  for (let i = 0; i < 5000; i++) {
    stars.push(star);
    console.log(stars);
    if (i < 5000) {
      setTimeout(starfill, 30);
    }
  }
}

starfill();

export default class Starback extends Component {
  componentDidMount() {}
  render() {
    return (
      <div>
        <h2>hello calle</h2>
        <div className="stars">{stars}</div>
      </div>
    );
  }
}
